RU:
ЛЕГЕНДАРНАЯ АРЕНА И СЕЗОНЫ
- Легендарная арена: открывается при 3 000 трофеев;
- Сезоны: каждые две недели трофеи игроков, набравших больше 3 000 трофеев, будут сброшены до 3 000. Сброшенные трофеи превратятся в легендарные!

​ПРАВИЛА ТУРНИРА
- Турнирные поединки теперь проводятся по \q«турнирным стандартам»,\q где уровни подгоняются для более честной игры! Уровни следующие: король и королевские башни получают уровень 8, обычные карты — 8, редкие — 6, эпические — 3, также дается 3 минуты доп. времени. Удачных вам турниров!

БАЛАНС И ДРУГИЕ ПЕРЕМЕНЫ
- Стоимость сражений: мы убрали плату золотом за бои и дружеские поединки;
- Баланс: мы изменили несколько карт, подробнее можно узнать на www.clashroyale.com;
- Исправлены ошибки: застрявшие ведьмы, iMessage и многие другие.
